import Foundation
import Alamofire

struct DetectedLandmark: Codable {
  let text: String
  enum CodingKeys: String, CodingKey {
    case text = "description"
  }
  init(from decoder: Decoder) throws {
    let container = try decoder.container(keyedBy: CodingKeys.self)
    text = try container.decode(String.self, forKey: .text)
  }
}

struct LDResult: Codable {
  let detectedLandmarks: [DetectedLandmark]
  enum CodingKeys: String, CodingKey {
    case detectedLandmarks = "landmarkAnnotations"
  }
  init(from decoder: Decoder) throws {
    let container = try decoder.container(keyedBy: CodingKeys.self)
    detectedLandmarks = try container.decode([DetectedLandmark].self, forKey: .detectedLandmarks)
  }
}

struct GoogleCloudLDResponse: Codable {
  let responses: [LDResult]
  enum CodingKeys: String, CodingKey {
    case responses = "responses"
  }
  init(from decoder: Decoder) throws {
    let container = try decoder.container(keyedBy: CodingKeys.self)
    responses = try container.decode([LDResult].self, forKey: .responses)
  }
}




class GoogleCloudAPI {
  private let apiKey = "AIzaSyB3Rtf6kKP2zzs9HN3zzpJMu1oUtDYk4_4"
  private var apiURL: URL {
    return URL(string: "https://vision.googleapis.com/v1/images:annotate?key=\(apiKey)")!
  }

    func detect( image : UIImage,completion: @escaping (DetectedLandmark?) -> Void){
        guard let base64Image = base64EncodeImage(image: image) else {
      print("Error while base64 encoding image")
      completion(nil)
      return
    }
     callGoogleVisionAPI(with: base64Image, completion: completion)
  }

  private func callGoogleVisionAPI(
    with base64EncodedImage: String,
    completion: @escaping (DetectedLandmark?) -> Void)  {
    let parameters: Parameters = [
      "requests": [
        [
          "image": [
            "content": base64EncodedImage
          ],
          "features": [
            [
              "type": "LANDMARK_DETECTION"
            ]
          ]
        ]
      ]
    ]
    let headers: HTTPHeaders = [
      "X-Ios-Bundle-Identifier": Bundle.main.bundleIdentifier ?? "",
      ]
    Alamofire.request(
      apiURL,
      method: .post,
      parameters: parameters,
      encoding: JSONEncoding.default,
        headers: headers)
      .responseData { response in
        if response.result.isFailure {
          completion(nil)
          return
        }
        guard let data = response.result.value else {
              completion(nil)
              return
            }
        
        print( data)
        let ldResponse = try? JSONDecoder().decode(GoogleCloudLDResponse.self, from: data)
        completion(ldResponse?.responses[0].detectedLandmarks[0])
//        landmarkResponse = response.result.debugDescription
//        response.data["response"][0]["landmarkAnnotations"][0]["description"]
        
    }

  }

    private func base64EncodeImage(image:UIImage) -> String? {
    return image.pngData()?.base64EncodedString(options: .endLineWithCarriageReturn)
    return ""
  }
}

